function TicketsPage() {
  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      {/* En-tête avec filtres */}
      <div style={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center', 
        marginBottom: '20px'
      }}>
        <h1 style={{ fontSize: '24px', fontWeight: '600' }}>My tickets</h1>
        <div style={{ display: 'flex', gap: '10px' }}>
          <button style={filterButtonStyle}>Search</button>
          <button style={filterButtonStyle}>All requests</button>
          <button style={filterButtonStyle}>Sort</button>
          <button style={filterButtonStyle}>Updated at</button>
        </div>
      </div>

      <hr style={{ border: '1px solid #e0e0e0', margin: '20px 0' }} />

      {/* Bouton principal */}
      <div style={{ marginBottom: '30px' }}>
        <button style={primaryButtonStyle}>
          New ticket
        </button>
      </div>

      {/* État vide */}
      <div style={{ 
        textAlign: 'center', 
        padding: '40px 20px',
        border: '1px dashed #e0e0e0',
        borderRadius: '8px',
        backgroundColor: '#fafafa'
      }}>
        <h2 style={{ 
          fontSize: '20px',
          fontWeight: '500',
          marginBottom: '10px',
          color: '#666'
        }}>
          No records found
        </h2>
      </div>

      {/* Pagination */}
      <div style={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center',
        marginTop: '20px',
        color: '#666',
        fontSize: '14px'
      }}>
        <span>Showing 1 to 0 of 0 results</span>
        <div style={{ display: 'flex', gap: '10px' }}>
          <button style={paginationButtonStyle} disabled>Previous</button>
          <button style={paginationButtonStyle} disabled>Next</button>
        </div>
      </div>
    </div>
  );
}

// Styles constants
const primaryButtonStyle = {
  padding: '10px 20px',
  backgroundColor: '#007bff',
  color: 'white',
  border: 'none',
  borderRadius: '6px',
  cursor: 'pointer',
  fontSize: '14px',
  fontWeight: '500'
};

const filterButtonStyle = {
  padding: '8px 16px',
  backgroundColor: '#ffffff',
  color: '#333333',
  border: '1px solid #dddddd',
  borderRadius: '6px',
  cursor: 'pointer',
  fontSize: '14px',
  boxShadow: '0 1px 2px rgba(0,0,0,0.05)'
};

const paginationButtonStyle = {
  padding: '6px 12px',
  backgroundColor: 'transparent',
  color: '#666666',
  border: '1px solid #dddddd',
  borderRadius: '4px',
  cursor: 'not-allowed',
  fontSize: '14px'
};

export default TicketsPage;
